import React from 'react'
import '../App.css'
import About from './About'
import Adopt from './Adopt'
import {useState} from 'react'

function Profile(props) {

  function setP(){
    props.onClick('home')
  }

  const [which,setWhich] = useState('about')

  function setAbout(){
    setWhich('about')
  }

  function setAdopt(){
    setWhich('adopt')
  }
  return (
    <div>
    <div onClick={setP} style={{'marginLeft':'4vw','fontSize':'3.5vh','marginTop':'2vh','textDecoration':'underline','pointer':'cursor'}}>
      {'<'}Home
    </div>
    <div className='prof'>{props.val}</div>
    <div className='content'>
      <div className='nav'>
        <button className='but' onClick={setAbout}>About</button>
        <button className='but' onClick={setAdopt}>Adopt</button>
        <button className='but'>Foster</button>
        <button className='but'>Stories</button>
        <button className='but'>Volunteer</button>
        <button className='but'>More...</button>


      </div>
      {which==='about'?<About />: which==='adopt'?<Adopt />: null}
    </div>
    </div>
  )
}

export default Profile
